}

::-webkit-scrollbar-thumb:hover {
  background: rgba(150, 150, 150, 1);
}

::-webkit-scrollbar-track-piece {
  background: #333;
}

.replayer-wrapper {
  position: relative;
}

.replayer-mouse {
  position: absolute;
  width: 20px;
  height: 20px;
  transition: .05s linear;
  background-size: contain;
  background-position: 50%;
  background-repeat: no-repeat;
  background-image: url('data:image/svg+xml;base64,');
}

.replayer-mouse:after {
  content: "";
  display: inline-block;
  width: 20px;
  height: 20px;
  border-radius: 10px;
  background: #4950f6;
  transform: translate(-10px,-10px);
  opacity: .3;
}

.replayer-mouse.active:after {
  animation: click .2s ease-in-out 1;
}

.replayer-mouse-tail {
  position: absolute;
  pointer-events: none;
}

@keyframes click {
  0% {
    opacity: .3;
    width: 20px;
    height: 20px;
    border-radius: 10px;
    transform: translate(-10px,-10px);
  }

  50% {
    opacity: .5;
    width: 10px;
    height: 10px;
    border-radius: 5px;
    transform: translate(-5px,-5px);
  }
}

.replayer-wrapper>iframe {
  border: none;
}

.replayer-wrapper {
  position: relative;
  float: left;
  clear: both;
  top: 50%;
  left: 50%;
}

